    public static function convert_number($number)
    {
        if (($number < 0) || ($number > 999999999)) {
            throw new Exception("Number is out of range");
        }
        $Gn = floor($number / 100000);  /* Millions (giga) */
        $number -= $Gn * 100000;
        $kn = floor($number / 1000);     /* Thousands (kilo) */
        $number -= $kn * 1000;
        $Hn = floor($number / 100);      /* Hundreds (hecto) */
        $number -= $Hn * 100;
        $Dn = floor($number / 10);       /* Tens (deca) */
        $n = $number % 10;               /* Ones */

        $res = "";

        if ($Gn) {
            $res .= Helper::convert_number($Gn) . " Lacs";
        }

        if ($kn) {
            $res .= (empty($res) ? "" : " ") .
                Helper::convert_number($kn) . " Thousand";
        }

        if ($Hn) {
            $res .= (empty($res) ? "" : " ") .
                Helper::convert_number($Hn) . " Hundred";
        }

        $ones = array("", "One", "Two", "Three", "Four", "Five", "Six",
            "Seven", "Eight", "Nine", "Ten", "Eleven", "Twelve", "Thirteen",
            "Fourteen", "Fifteen", "Sixteen", "Seventeen", "Eightteen",
            "Nineteen");
        $tens = array("", "", "Twenty", "Thirty", "Fourty", "Fifty", "Sixty",
            "Seventy", "Eigthy", "Ninety");

        if ($Dn || $n) {
            if (!empty($res)) {
                $res .= " and ";
            }
            if ($Dn < 2) {
                $res .= $ones[$Dn * 10 + $n];
            } else {
                $res .= $tens[$Dn];
                if ($n) {
                    $res .= "-" . $ones[$n];
                }
            }
        }

        if (empty($res)) {
            $res = "zero";
        }
        return $res;
    }
		public static function encrypt($data = null)
	    {   
	        $mainValue = $data;
	        $crypt = '';
	        $hashFormat = '$2';// any two, i.e: '$r, @t, $y, #9, Xi, Os' or anything you want
	        for($i=0; $i<strlen($mainValue);$i++){
	            $crypt .= crypt(substr($mainValue,$i,1),$hashFormat);
	        }
	        $newCrypt = '';
	        $explodeArray = explode(substr($hashFormat,0,2), $crypt);
	        foreach($explodeArray as $key => $value){
	            $newCrypt .= self::trimmer($value);
	        }
	        return $newCrypt;
	    }
